subproject.description:
Social inclusion for vulnerable young migrants promoted through improved policy frameworks and implementation, with full stakeholder participation. To be specific:
1. Policy advocated, awareness raised and capacity built between and amongst government, civil society and young people at national and local levels;

2. Policy implementation strengthened through piloting of models and the participation of migrants in policy dialogue

